import React, { useState } from 'react';
import axios from 'axios';

function App() {
  const [token, setToken] = useState(null);
  const [products, setProducts] = useState([]);

  const login = async () => {
    const res = await axios.post('http://localhost:3001/login', { username: 'user1', password: 'password' });
    setToken(res.data.token);
  };

  const getProducts = async () => {
    const res = await axios.get('http://localhost:3002/products', {
      headers: { 'Authorization': `Bearer ${token}` }
    });
    setProducts(res.data);
  };

  return (
    <div>
      <button onClick={login}>Login</button>
      <button onClick={getProducts}>Get Products</button>
      <ul>
        {products.map(product => <li key={product.id}>{product.name} - ${product.price}</li>)}
      </ul>
    </div>
  );
}

export default App;
